import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import icon from '../../../img/icon.png'
import { Container, Row, Col, Nav, Button, Navbar, Form, FormControl, Carousel} from 'react-bootstrap';
import classes from './Posts.module.css';
import Post from './post/post'
const MyPosts = (props) => {
    let postsElements =
        props.posts.map( p => <Post message={p.message} likesCount={p.likesCount}/>);
        }
const Posts = () => {
    return (
        <div className={classes.posts}>
                <img className={classes.post__img} src={icon}/>
                <p>
                Free Download Avatar SVG vector file in monocolor and multicolor type for Sketch or Illustrator from Avatar Vectors svg vector collection. Avatar Vectors SVG vector illustration graphic art design format.
                </p>
                <h3>My posts</h3>
            <div>
                <div>
                    <textarea></textarea>
                </div>
                <div>
                    <button>Add post</button>
                </div>
            </div>
            <div className={s.posts}>
                { postsElements }
            </div>
        </div>
    );
}
export default Posts;
